import React from 'react';

class content extends React.Component{
    constructor(props){
        super(props);
        this.state=this.location.props;
    }
    render(){
        return(
            <div>
                <h1>{this.state["heading"]}</h1>
                <p>{this.state["content"]}</p>
            </div>
        )
    }
}
